import { Form, InputGroup, ListGroup, } from "react-bootstrap";

export default function Todo({ todo: { id, name, checked }, checkTodo }) {

  function handleCheck() {
    checkTodo(id)
  }

  return (
    <ListGroup.Item className="todo-item" variant={checked ? "info" : "secondary"} >
      <Form.Check.Input className="checkbox" onChange={handleCheck} />
      <InputGroup>
        <InputGroup.Checkbox />
        <InputGroup.Text>{name}</InputGroup.Text>
      </InputGroup>
    </ListGroup.Item>
  )
}
